import React, { useState } from 'react';
import axios from 'axios';
import { TextField, Button, Grid, Box, Typography, Snackbar } from '@mui/material';

const UpdatePatient = () => {
    const [phoneNo, setPhoneNo] = useState('');
    const [patientData, setPatientData] = useState({
        name: '',
        age: '',
        gender: '',
        email: '',
        address: ''
    });
    const [message, setMessage] = useState('');
    const [isPatientFound, setIsPatientFound] = useState(false);
    const [openSnackbar, setOpenSnackbar] = useState(false);

    // Handle input changes
    const handleChange = (e) => {
        const { name, value } = e.target;
        setPatientData({ ...patientData, [name]: value });
    };

    // Fetch patient data based on phone number
    const searchPatient = async () => {
        try {
            const response = await axios.get(`http://localhost:3001/search-patient/${phoneNo}`);
            setPatientData(response.data.patient);
            setIsPatientFound(true);
            setMessage('');
        } catch (err) {
            setMessage('Patient not found');
            setIsPatientFound(false);
            setPatientData({
                name: '',
                age: '',
                gender: '',
                email: '',
                address: ''
            });
        }
    };

    // Update patient data
    const updatePatient = async () => {
        if (!isPatientFound) {
            setMessage('Patient not found. Please search first.');
            setOpenSnackbar(true);
            return;
        }

        // Check if any field is empty
        if (!patientData.name || !patientData.age || !patientData.gender || !patientData.email || !patientData.address) {
            setMessage('All fields are required.');
            setOpenSnackbar(true);
            return;
        }

        try {
            const response = await axios.put('http://localhost:3001/update-patient', {
                phoneNo,
                ...patientData
            });
            setMessage(response.data.message);
            setOpenSnackbar(true);
        } catch (err) {
            setMessage('Error updating patient.');
            setOpenSnackbar(true);
        }
    };

    return (
        <Box sx={{ p: 4, maxWidth: 600, margin: '0 auto' }}>
            <Typography variant="h4" gutterBottom>Update Patient</Typography>

            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <TextField
                        fullWidth
                        label="Enter phone number"
                        value={phoneNo}
                        onChange={(e) => setPhoneNo(e.target.value)}
                        required
                    />
                </Grid>
                <Grid item xs={12}>
                    <Button variant="contained" color="primary" onClick={searchPatient}>Search</Button>
                </Grid>
            </Grid>

            {message && <Snackbar open={openSnackbar} autoHideDuration={4000} onClose={() => setOpenSnackbar(false)} message={message} />}

            {isPatientFound && (
                <form>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Name"
                                name="name"
                                value={patientData.name}
                                onChange={handleChange}
                                required
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Age"
                                name="age"
                                value={patientData.age}
                                onChange={handleChange}
                                required
                                type="number"
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Gender"
                                name="gender"
                                value={patientData.gender}
                                onChange={handleChange}
                                required
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Email"
                                name="email"
                                value={patientData.email}
                                onChange={handleChange}
                                required
                                type="email"
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Address"
                                name="address"
                                value={patientData.address}
                                onChange={handleChange}
                                required
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <Button variant="contained" color="primary" onClick={updatePatient}>Update</Button>
                        </Grid>
                    </Grid>
                </form>
            )}
        </Box>
    );
};

export default UpdatePatient;
